import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'

function App() {
  return (
    <Router>
      <ul>
        <li>Home</li>
        <li>Contato</li>
      </ul>
      <Routes>
        <Route exact path="" elemente={Home} />
      </Routes>
      <p>Footer</p>
    </Router>
  );
}

export default App;
